// src/App.js
import React from 'react';
import DigitalCard from './DigitalCard';

function App() {
  const companyInfo = {
    logoUrl: "/path/to/logo.png", // Replace with the actual path to your logo
    companyName: "Deepak & Company",
    phoneNumber: "+1234567890",
    whatsappNumber: "1234567890", // No "+" sign
    email: "info@deepakcompany.com",
    locationUrl: "https://maps.google.com/?q=Your+Location+Here", // Google Maps link
    websiteUrl: "https://www.deepakcompany.com",
    shopUrl: "https://www.deepakcompany.com/shop"
  };

  return (
    <div className="App">
      <DigitalCard {...companyInfo} />
    </div>
  );
}

export default App;
